import { CDN_IMG } from "../utils/constants";

const RestaurantCard = (props) => {
    // const {resName, resCuisine} = props;
    const {restoData} = props?.cards[2]?.groupedCard?.cardGroupMap?.REGULAR.cards[1]?.card?.card?.itemCards;

    const {name, cuisines, cloudinaryImageId, avgRating} = restoData;

    // const {name, cuisines, cloudinaryImageId, avgRating} = props;


    // console.log(typeof restoData)
    // console.log(restoData[1].data.data)
    // console.log(restoData[1].data.data.name)
    return (
        <div className="p-12 m-12 bg-gray-100 rounded-lg">
            <img className="rounded-lg" alt="res-logo" src={ CDN_IMG + cloudinaryImageId}></img>
            <h3 className="font-bold">{name}</h3>
            <h3>{cuisines.join(", ")}</h3>
            <h3>{avgRating + "⭐️"}</h3>
            {/* <h3></h3> */}
        </div>
    )
}

export default RestaurantCard;
